func TestInit(t *testing.T) {

	jsons := strings.ReplaceAll(jsons, "\t", "")
	lines := strings.Split(jsons, "\n")

	type Caption struct {
		Ru string `json:"ru"`
		En string `json:"en"`
	}

	type Obj struct {
		ID       uint64  `json:"id"`
		Captions Caption `json:"captions"`
	}

	result := make([]Obj, 0)

	for _, line := range lines {
		if strings.Index(line, "id") > 0 &&
			strings.Index(line, "captions") > 0 &&
			strings.Index(line, "content") > 0 {
			obj := Obj{}

			err := json.Unmarshal([]byte(line), &obj)
			if err != nil {
				continue
			}

			result = append(result, obj)
		}
	}

	log.Println(result)
}
